import React from 'react';
import './AddNewPost.css';


function AddNewPost() {
    
  return (
    <>
        <div className='add-container'>
            <div className='form-container'>  
                    <input type='file'/>
                    <input type='text'/>
                    <input type='fialed'/>
            </div>
        </div>
    </>
  )
}

export default AddNewPost
